import { Card } from "react-bootstrap";


const Note =(props)=> {
    const { id, title, content } = props.data;

    return(
        <Card key={props.key}>
            <Card.Title>{title}</Card.Title>
            <Card.Body>{content}</Card.Body>
        </Card>
    );
}

export default Note;
